How to set up web push notifications for web apps on Apple Safari iOS 16.4 using the Add to Home Screen Push API 2025 documentation
Setting up web push notifications for Safari on iOS 1
6.4 and later requires a standards-based approach using the Push API, Service Workers, and a Web App Manifest.
 Unlike traditional push notifications for native apps, you do not need a paid Apple Developer account.

Here is a comprehensive guide to implementing
 web push for your progressive web app (PWA) on iOS:

### **1. Prerequisites**

*   **
HTTPS:** Your web application must be served over a secure (HTTPS) connection.
*   **iOS Version:** The
 user's device must be running iOS 16.4 or iPadOS 16.4 or a more
 recent version.
*   **Add to Home Screen:** The user must have added your web app to their Home Screen.
 This is a crucial step, as push notifications are only delivered to PWAs, not to websites visited in the browser.

###
 **2. Client-Side Implementation**

#### **Step 2.1: Create a Web App Manifest (`manifest.json
`)**

The manifest file tells the browser that your web app is installable. Create a `manifest.json` file in the
 root of your project with the following minimum fields:


```json
{
  "name": "Your Web App Name",

  "short_name": "App Name",
  "start_url": "/",
  "display": "standalone"

}

```


Link to this file from the `<head>` of your main HTML file:


```html

<link rel="manifest" href="/manifest.json">

```


#### **Step 2.2: Create
 a Service Worker (`service-worker.js`)**

The service worker is a JavaScript file that runs in the background and
 handles incoming push messages.


```javascript
// service-worker.js

self.addEventListener('push', function(event) {

  const data = event.data ? event.data.json() : {};
  const title = data.title || '
Default Title';
  const options = {
    body: data.body || 'Default body',
    icon: '/images
/icon.png', // Optional
  };

  event.waitUntil(self.registration.showNotification(title
, options));
});

```


