macOS)**

For Safari on macOS versions prior to Ventura (13.0), you'll need to use
 the legacy Apple Push Notification service (APNs). This requires a paid Apple Developer account to generate a Website Push ID and certificate. You
 can use feature detection in your JavaScript to check for the `safari` object in the `window` and use the legacy
 `window.safari.pushNotification` API if it exists.

However, since your focus is on iOS 16.
4+, the standards-based approach described above is the correct and modern way to implement web push notifications.

